export default function Navbar() {
  return (
    <nav className="flex items-center justify-center py-4 bg-black text-white">
      {/* Left nav links */}
      <div className="flex items-center space-x-6">
        <a href="#projects" className="tracking-[0.3em] text-sm hover:text-gray-300">PROJECTS</a>
        <span className="w-px h-4 bg-gray-700"></span>
        <a href="#services" className="tracking-[0.3em] text-sm hover:text-gray-300">SERVICES</a>
      </div>

      {/* Center logo */}
      <div className="mx-20">
        <img src="/images/OM-Logo(Canva Design).png" alt="Logo" className="h-6" />
      </div>

      {/* Right nav links */}
      <div className="flex items-center space-x-16">
        <a href="#about" className="tracking-[0.3em] text-sm hover:text-gray-300">ABOUT</a>
        <span className="w-px h-4 bg-gray-700"></span>
        <a href="#contact" className="tracking-[0.3em] text-sm hover:text-gray-300">CONTACT</a>
      </div>
    </nav>
  );
}
